import React , {useEffect, useState} from "react";
import AddDriver from './AddDriver';
import Address from './info/Address';
import BasicInfo from './info/BasicInfo';
import {
    Breadcrumb,
    BreadcrumbItem,
    Button,
    Card,
    CardBody,
    CardTitle,
    Container,
    Row,
    Col,
    FormGroup,
    Input
  } from "reactstrap";

function Driver(props){
	return(
    <>
      <div className="add-driver mt-5">
        <Container fluid>
          <Row>
  	        <BasicInfo/>
            <Address/>
          </Row>
        </Container>
      </div>
    </>
	);
}


export default Driver;
